        }
    },
    "i18n": {},
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "tile-groups": {
            "type": "object"
        },
        "un-pin-tile-callback": {
            "type": "action"
        },
        "tile-click-callback": {
            "type": "action"
        },
        "update-tile-callback": {
            "type": "action"
        }
    },
    "_viewModelId": "AwTileCanvas",
    "_uniqueViewModelId": "AwTileCanvas",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awTileCanvasRenderFunction, undefined, ctxImportObj );

export default Component;
